import 'dart:convert';

import 'package:flutter/material.dart';
import 'editor.dart';

class Gallery extends StatefulWidget {
  @override
  GalleryState createState() => GalleryState();
}

class GalleryState extends State<Gallery> {
  List<Widget> _getImages(BuildContext context) {
    List<Widget> imagesList = <Widget>[];
    var images = {
      'dash': Image(
          image: Image.asset(('assets/images/dash.jpg'))
              .image // .image is ImageProvider
          ),
      //'dash1': Image.file(File('/storage/emulated/0/DCIM/Camera/Test.jpg')),
      'dash2': Image.asset('assets/images/dash2.jpeg'),
      'dash3': Image.asset('assets/images/dash3.png'),
      'dash4': Image.network(
        'https://raw.githubusercontent.com/kevmoo/dart_side/master/Dash%20Dart%20PNG%20%20-%20white.png',
        loadingBuilder: (context, child, progress) {
          if (progress == null) return child;
          return Center(
            child: LinearProgressIndicator(
              value: progress.expectedTotalBytes != null
                  ? progress.cumulativeBytesLoaded / progress.expectedTotalBytes
                  : null,
            ),
          );
        },
      ),
      'dash5': Image.memory(base64Decode(
          ''))
    };

    var nav = (image) {
      Navigator.push(
        context,
        MaterialPageRoute(
          builder: (BuildContext context) => Editor(image: image),
        ),
      );
    };
    for (var i = 0; i < 12; i++) {
      for (var key in images.keys) {
        imagesList.add(
          GestureDetector(
            onTap: () => nav(images[key]),
            child: Container(
              child: images[key],
            ),
          ),
        );
      }
    }

    return imagesList;
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Center(
          child: Text('Photos'),
        ),
        leading: IconButton(
          icon: Icon(
            Icons.menu,
            color: Colors.white,
          ),
          onPressed: () {},
        ),
        actions: <Widget>[
          IconButton(
            icon: Icon(
              Icons.more_vert,
              color: Colors.white,
            ),
            onPressed: () {},
          )
        ],
      ),
      backgroundColor: Colors.white,
      body: Center(
        child: GridView.count(
          padding: const EdgeInsets.all(20),
          crossAxisSpacing: 10,
          mainAxisSpacing: 10,
          crossAxisCount: 2,
          children: _getImages(context),
        ),
      ),
    );
  }
}
